  false,\n\t\"url\": null,\n\t\"notes\": \"The 2005 Idaho CDL is part of a joint research
  project with Utah State University, the United Potato Growers of Idaho and the Farm
  Service Agency. This 30 meter version of the USDA-NASS 2005 Idaho Cropland Data
  Layer is a raster, geo-referenced, categorized land cover data layer produced using
  satellite imagery from the Thematic Mapper (TM) instrument on Landsat 5. The approximate
  scale is 1:100,000 with a ground resolution of 30 meters by 30 meters. The area
  of coverage for 2005 is the southern half of Idaho. This is part of an annual series
  in which several states are categorized annually based on the extensive field observations
  collected during the annual NASS June Agricultural Survey. Please refer to the 'Supplemental_Information'
  Section of this metadata file for a complete list of all imagery, ancillary data,
  and training/validation data used to generate this state's CDL. The strength and
  emphasis of the CDL is agricultural land cover. Please note that no farmer reported
  data are derivable from the Cropland Data Layer.\",\n\t\"license_title\": null,\n\t\"extras\":
